const initialData = {
    tasks: {
        'task-1': { id: '1', content: 'play volleyball' },
        'task-2': { id: '2', content: 'learn react' },
        'task-3': { id: '3', content: 'work on GEDE' },
        'task-4': { id: '4', content: 'drink coke' }
    },
    columns: {
        'column-1': {
            id: 'column-1',
            title: 'To do',
            taskIds: ['1', '2', '3', '4'],
        },
    },
    columnOrder: ['column-1'],
};

export default initialData;
